
testInput = 'bvwbjplbgvbhsrlpgdmjqwftvncz'

def findCode( inputStr ):
    i = 14
    marker = inputStr[:i]
    markerLoc = i
    for x in inputStr[i:]:
        if len(set(marker)) == i:
            break
        marker = marker[1:] + x
        markerLoc += 1
    return markerLoc

print(findCode( testInput ))

actualInput = ''

print(findCode(actualInput))